	(2668,'WBGene00000120','2010-10-01','2010-10-01','aly-1','aly-1 encodes an RRM motif-containing protein required for normal export of TRA-1/tra-2 mRNA complexes, and thus for normal hermaphroditism; ALY-1 is orthologous to human THOC4 (OMIM:604171), and paralogous to ALY-2 and ALY-3; in the absence of TRA-1, and in conjunction with NXF-2, ALY-1 and its paralog ALY-2 are required to bind the TRE 3'' UTR element of tra-2 mRNA, and block tra-2 mRNA''s export from the nucleus; ALY-1 and NXF-2 bind the TRE element in vitro','Caenorhabditis elegans',6239,'RRMx1',0,NULL,NULL,NULL,NULL,'Q17561'),
	(2669,'WBGene00000122','2010-10-01','2010-10-01','aly-3','aly-3 encodes an RRM motif-containing protein orthologous to human THOC4 (OMIM:604171), and paralogous to ALY-1 and ALY-2; by orthology, ALY-3 is thought to promote recruitment of mRNA export factor to mRNAs; however, ALY-3 has no grossly obvious function in four-way RNAi assays of ALY-1/-3 and W04D2.6, and aly-3(RNAi) had no obvious effect on nuclear retention of tra-2 mRNA in the absence of TRA-1.','Caenorhabditis elegans',6239,'RRMx1',0,NULL,NULL,NULL,NULL,'Q21559'),
	(2670,'WBGene00000246','2010-10-01','2010-10-01','bcc-1','bcc-1 encodes a homolog of Drosophila and vertebrate Bicaudal C (BICC) that contains KH RNA-binding domains, a serine-rich region, and a SAM (sterile alpha motif) domain; by homology, BCC-1 is predicted to function as a cytoplasmic RNA-binding protein that is required for translational regulation and/or mRNA stability during embryonic or germline development; however, as loss of bcc-1 activity via large-scale RNAi screens does not result in any obvious abnormalities, the precise role of BCC-1 in','Caenorhabditis elegans',6239,'KHx1; SAMx1',0,NULL,NULL,NULL,NULL,'Q21593'),
	(2671,'WBGene00000472','2010-10-01','2010-10-02','cey-1','cey-1 encodes a protein with a cold-shock/Y-box domain that is expressed in early embryonic blastomeres (at the 15-cell stage, i.e., pre-gastrulation), but is normally repressed in early germline blastomeres by PIE-1; it is predicted to be mitochondrial by phylogenetic profiling.','Caenorhabditis elegans',6239,'CSDx1',0,NULL,NULL,NULL,NULL,'O62213'),
	(2672,'WBGene00000473','2010-10-01','2010-10-02','cey-2','cey-2 encodes a cold-shock/Y-box domain-containing protein; by homology, CEY-2 is predicted to function as either an RNA-binding protein involved in translation or RNA processing, or a DNA-binding protein involved in transcriptional regulation; cey-2 mRNA is expressed maternally in the early embryo, in a pattern characteristic of class II maternal RNAs, which are initially detected throughout the embryo but restricted to the P, or germline, lineage as cell division progresses; CEY-2 associates w','Caenorhabditis elegans',6239,'CSDx1',0,NULL,NULL,NULL,NULL,'P91306'),
	(2673,'WBGene00000474','2010-10-01','2010-10-02','cey-3','cey-3 encodes a protein with a cold-shock/Y-box domain; CEY-3 associates with CGH-1, CEY-2, and CEY-4 in cytoplasmic particles of the gonad and early embryo.','Caenorhabditis elegans',6239,'CSDx1',0,NULL,NULL,NULL,NULL,'P91398'),
	(2674,'WBGene00000475','2010-10-01','2010-10-02','cey-4','cey-4 encodes a Y box-containing protein with no known function in vivo; CEY-4 associates with CGH-1 and CEY-2/3 in cytoplasmic particles of the gonad and early embryo.','Caenorhabditis elegans',6239,'CSDx1',0,NULL,NULL,NULL,NULL,'Q9XTJ6'),
	(2675,'WBGene00000564','2010-10-01',NULL,'cnk-1','cnk-1 encodes a protein that contains a SAM domain, a PDZ domain, and a PH domain.','Caenorhabditis elegans',6239,NULL,1,'SAM domain',NULL,NULL,NULL,NULL),
	(2676,'WBGene00000770','2010-10-01','2010-10-02','cpb-1','cpb-1 encodes a cytoplasmic polyadenylation element binding (CPEB) protein homolog involved in two steps of spermatogenesis; two CPEB proteins have distinct functions in spermatogenesis, with FOG-1 specifying sperm cell fate, and CPB-1 conversely executing that decision, being required for progression through meiosis; cpb-1(RNAi) spermatocytes fail to undergo meiotic cell divisions; CPB-1 protein is present in the germ line just prior to overt spermatogenesis, but once sperm differentiation begi','Caenorhabditis elegans',6239,'RRMx2',0,NULL,NULL,NULL,NULL,'Q03571'),
	(2677,'WBGene00000771','2010-10-01','2010-10-02','cpb-2','cpb-2 encodes a cytoplasmic polyadenylation element binding (CPEB) protein homolog, expressed specifically in the spermatogenic germ line; CPB-2 is dispensable for oogenesis, in contrast to CPEBs in vertebrates (Xenopus), arthropods (Drosophila), and molluscs (Spisula), which all participate in oogenesis.','Caenorhabditis elegans',6239,'RRMx1',0,NULL,NULL,NULL,NULL,'Q18317'),
	(2678,'WBGene00000772','2010-10-01','2010-10-02','cpb-3','cpb-3 encodes a CPEB orthologous to Drosophila ORB, zebrafish ZORBA, and human CPEB1, and paralogous to FOG-1 and CPB-1/2; CPB-3 inhibits physiological apoptosis in oocytes, keeping it down to a normal level of ~50% in hermaphrodite gonads; independently of apoptosis, CPB-3 is also required for normal oogenesis, sperm/oocyte switching (upstream of FEM-3), and the transistion from mitosis to meiosis by oocytes (in parallel with GLD-3); cpb-3(RNAi) results in elevated (though not 100%) physiologic','Caenorhabditis elegans',6239,'RRMx1',0,NULL,NULL,NULL,NULL,'O01835'),
	(2679,'WBGene00000774','2010-10-01','2010-10-03','cpf-2','','Caenorhabditis elegans',6239,'RRMx1',0,NULL,NULL,NULL,NULL,'O45577'),
	(2680,'WBGene00000889','2010-10-01','2010-10-03','cyn-13','cyn-13 encodes a predicted cyclophilin that can function as a nuclease in vitro; functions to regulate DNA degradation and cell death in a genetic pathway with wah-1, cps-6, crn-1, crn-4, crn-5 and these proteins are believed to form a complex in vivo.','Caenorhabditis elegans',6239,'RRMx1',0,NULL,NULL,NULL,NULL,'Q9U2S6'),
	(2681,'WBGene00000890','2010-10-01','2010-10-03','sig-7','sig-7 encodes a predicted cyclophilin; loss of sig-7 activity via large-scale RNAi screens results in embryonic and larval lethality as well as reduced brood sizes, suggesting that SIG-7 plays an essential role during C. elegans development.','Caenorhabditis elegans',6239,'RRMx1',0,NULL,NULL,NULL,NULL,'O18161; Q8I4J2'),
	(2682,'WBGene00000935','2010-10-01','2010-10-03','daz-1','daz-1 encodes a protein containing an RNA recognition motif that is required for the progression of meiosis during oogenesis; DAZ-1 is expressed in the germline, and expression levels peak in the proximal pachytene region; cpb-3(bt17);daz-1(tj3) hermaphrodites have a synthetic phenotype of total sterility and masculinization; DAZ-1 colocalizes with CPB-3 in vivo, coimmunoprecipitates with CPB-3, and binds CPB-3 in two-hybrid assays.','Caenorhabditis elegans',6239,'RRMx1',0,NULL,NULL,NULL,NULL,'Q20870'),
	(2683,'WBGene00001230','2010-10-01','2010-10-03','eif-3.G','eif-3.G encodes a homolog of eukaryotic translation initiation factor 3, subunit 4 that affects embryonic viability, fertility, and growth.','Caenorhabditis elegans',6239,'RRMx1',0,NULL,NULL,NULL,NULL,'Q19706'),
	(2684,'WBGene00001259','2010-10-01','2010-10-03','emb-5','emb-5 encodes the C. elegans ortholog of the Spt6 family of RNA polymerase II transcription elongation factors; first identified in screens for temperature-sensitive embryonic lethal mutations, emb-5 is required for the correct timing of the second E (endoderm)-cell division in the early embryo and thus, for normal embryonic gastrulation; in addition, emb-5 activity is required postembryonically for proper gonad development; in yeast two-hybrid studies.','Caenorhabditis elegans',6239,'S1x1',0,NULL,NULL,NULL,NULL,'P34703'),
	(2685,'WBGene00001340','2010-10-01','2010-10-03','etr-1','etr-1 encodes a muscle-specific ELAV-type RNA-binding protein, whose homologs include Drosophila ELAV and human CUG-BINDING PROTEIN (CUGBP1; OMIM:601074); etr-1 function is required for embryonic muscle development, which suggests that ETR-1''s homology to CUG-BP (implicated in myotonic dystrophy) might reflect conserved roles in development.','Caenorhabditis elegans',6239,'RRMx3',0,NULL,NULL,NULL,NULL,'Q17385; A8DYR9; Q86NC4; A8DYS3; A8DYS1; A8DYS0; A7KQE9'),
	(2686,'WBGene00001368','2010-10-01','2010-10-03','exc-7','exc-7 encodes an ELAV, an mRNA-binding protein homologous to Drosophila ELAV and human HuC/D (OMIM:603458, 168360, autoimmune antigens associated with paraneoplastic neurologic disorders); EXC-7 is required for formation of the tailspike and the excretory cell canals; exc-7 mutations enhance defects produced by mutations in exc-3, predicted to encode a peptidase, and sma-1, which encodes beta H-spectrin, a key component of the apical cytokeleton of polarized epithelial cells such as the excretor','Caenorhabditis elegans',6239,'RRMx3',0,NULL,NULL,NULL,NULL,'Q20084'),
	(2689,'WBGene00001481','2010-10-01','2010-10-04','fog-1','The fog-1 gene encodes a cytoplasmic polyadenylation element binding (CPEB) protein that is required for specification of the sperm fate.','Caenorhabditis elegans',6239,'RRMx2; Znf_C2H2x1',0,NULL,NULL,NULL,NULL,'Q95XX9; Q9GNI9'),
	(2690,'WBGene00001484','2010-10-01','2010-10-04','fox-1','fox-1 encodes an RNA-binding protein of the RNA recognition motif (RRM) superfamily of ribonucleic acid binding proteins; during C. elegans development, FOX-1 functions redundantly with other numerator elements to effect proper dosage compensation in the early embryo; in influencing dosage compensation, FOX-1 likely acts via post-transcriptional regulation of xol-1 mRNA levels; in addition to its role in dosage compensation, fox-1 activity is also required for normal male mating behavior; Wester','Caenorhabditis elegans',6239,'RRMx1',0,NULL,NULL,NULL,NULL,'Q10572'),
	(2692,'WBGene00001808','2010-10-01','2010-10-04','gut-2','gut-2 encodes a member of the Sm protein family with highest similarity to human U6 snRNA-associated Sm-like protein, LSm2, that affects embryonic viability.','Caenorhabditis elegans',6239,'LSmx1',0,NULL,NULL,NULL,NULL,'P92022'),
	(2693,'WBGene00001999','2010-10-01','2010-10-04','hrp-1','The hrp-1 gene encodes a homolog of the human DRPLA gene (OMIM:125370), which when mutated leads to dentatorubral-pallidoluysian atrophy or to Haw River syndrome (OMIM:140340).','Caenorhabditis elegans',6239,'RRMx2',0,NULL,NULL,NULL,NULL,'Q22037'),
