	(2704,'WBGene00003172','2010-10-01','2010-10-04','mec-8','mec-8 encodes a protein with two RNA recognition motifs (RRM); mec-8 is required for proper development of body wall muscle and chemosensory and touch receptor neurons and as a result, for embryonic and larval development, sensory neuron fasciculation, and mechanosensation; MEC-8 functions as an mRNA processing factor whose activity is required for alternative splicing of genes such as unc-52/perlecan, with which it NUMBEReracts genetically to produce synthetic lethality at the two-fold stage of em','Caenorhabditis elegans',6239,'RRMx2',0,NULL,NULL,NULL,NULL,'Q19018'),
	(2705,'WBGene00003228','2010-10-01','2010-10-04','mex-1','mex-1 encodes a CCCH-type zinc-finger protein that is required maternally for segregation of P granules, germ cell formation, and somatic cell differentiation in the early embryo; MEX-1 is expressed cytoplasmically in germ line blastomeres, is a component of P granules, and is required for restricting PIE-1 expression and function to these cells; mex-1 mRNA transcripts are also transiently associated with P granules.','Caenorhabditis elegans',6239,'Znf_CCCHx2',0,NULL,NULL,NULL,NULL,'Q9XTB3'),
	(2707,'WBGene00003230','2010-10-01','2010-10-04','mex-5','mex-5 encodes a novel protein that contains two CCCH zinc finger motifs; maternally provided MEX-5, which functions partly redundantly with the highly similar CCCH finger protein MEX-6, is essential for transducing polarity cues and establishing soma/germline asymmetry in the early embryo; in regulating soma/germline asymmetry, MEX-5 NUMBEReracts with, and activates, the SOCS-box protein ZIF-1, which functions as part of an E3 ubiquitin ligase complex that degrades germ plasm proteins in somatic bl','Caenorhabditis elegans',6239,'Znf_CCCHx2',0,NULL,NULL,NULL,NULL,'Q9XUB2'),
	(2708,'WBGene00003231','2010-10-01','2010-10-04','mex-6','mex-6 encodes a CCCH zinc-finger protein highly similar to MEX-5 that functions with MEX-5 to affect embryonic viability, establish soma germline asymmetry in embryos and establish PIE-1, MEX-1, and POS-1 asymmetry in embryos, and also affects formation of NUMBERestinal cells; MEX-6 and MEX-5 may act downstream of the PAR proteins.','Caenorhabditis elegans',6239,'Znf_CCCHx2',0,NULL,NULL,NULL,NULL,'Q09436'),
	(2709,'WBGene00003388','2010-10-01','2010-10-04','moe-3','moe-3 encodes a CCCH tandem zinc finger (TZF) protein; while loss of moe-3 activity via RNAi alone results in no obvious abnormalities, animals triply mutant for moe-3, oma-1, and oma-2 demonstrate oocyte maturation defects, indicating that these genes likely function redundantly during germline development; in situ hybridization experiments indicate that moe-3 mRNA expression is relatively weak and restricted to the distal region of the gonad; based upon its sequence similarity to other TZF pro','Caenorhabditis elegans',6239,'Znf_CCCHx2',0,NULL,NULL,NULL,NULL,'Q9XV46'),
	(2710,'WBGene00003393','2010-10-01','2010-10-04','mog-5','The mog-5 gene encodes a DEAH helicase orthologous to the Drosophila CG8241, the human HRH1, and the S. cerevisiae PRP22 proteins.','Caenorhabditis elegans',6239,'S1x1',0,NULL,NULL,NULL,NULL,'Q09530'),
