	(2712,'WBGene00003516','2010-10-01',NULL,'nab-1','nab-1 encodes a PDZ and SAM domain-containing protein that is the sole C. elegans ortholog of the mammalian Neurabin/Spinophilin proteins; by homology, NAB-1 is predicted to NUMBEReract with F-actin, ZYG-8/Doublecortin and the SAD-1 serine/threonine kinase to regulate NUMBEReractions between the actin and microtubule networks during cell migration, growth cone guidance, and cell division; loss of nab-1 activity via RNAi has been reported to result in early embryonic lethality, dumpy and left-handed ro','Caenorhabditis elegans',6239,NULL,1,'SAM domain',NULL,NULL,NULL,NULL),
	(2713,'WBGene00003827','2010-10-01','2010-10-04','ntl-4','ntl-4 encodes two proteins by alternative splicing, one of which (NTL-4A) has an N-terminal RING finger and a RNA recognition motif (''RRM'', ''RBD'', or ''RNP''), and both of which have glutamine/asparagine-rich domains.','Caenorhabditis elegans',6239,'RRMx1',0,NULL,NULL,NULL,NULL,'Q9GYQ9; Q8T3E7'),
	(2714,'WBGene00003864','2010-10-01','2010-10-04','oma-1','The oma-1 gene encodes a zinc finger protein of the TIS11 finger type that is paralogous to OMA-2; while either oma-1 or oma-2 individually have no obvious mutant phenotype, a normal copy of at least one of these genes is required for oocyte maturation.','Caenorhabditis elegans',6239,'Znf_CCCHx2',0,NULL,NULL,NULL,NULL,'Q17877'),
	(2715,'WBGene00003865','2010-10-01','2010-10-04','oma-2','The oma-2 gene encodes a zinc finger protein of the TIS11 finger type that is paralogous to OMA-1; while either oma-1 or oma-2 individually have no obvious mutant phenotype, a normal copy of at least one of these genes is required for oocyte maturation.','Caenorhabditis elegans',6239,'Znf_CCCHx2',0,NULL,NULL,NULL,NULL,'Q23359'),
	(2716,'WBGene00003902','2010-10-01','2010-10-04','pab-1','pab-1 encodes a polyadenylate-binding protein (i.e., poly(A)-binding protein, or PAB); pab-1 is essential for germline proliferation, regulation of adult lifespan, and normal body size; PAB-1 forms a complex with ATX-2, the C. elegans ataxin 2 ortholog, which is also required for germline development; PAB-1 has been successfully used as an epitope-tagged transgenic reagent for tissue-specific isolation of mRNAs.','Caenorhabditis elegans',6239,'RRMx4',0,NULL,NULL,NULL,NULL,'Q9U302; Q7K798; Q7K797'),
	(2717,'WBGene00003903','2010-10-01','2010-10-04','pab-2','pab-2 encodes a polyadenylate-binding protein 1 homolog with high similarity to human PABP 1.','Caenorhabditis elegans',6239,'RRMx4',0,NULL,NULL,NULL,NULL,'Q19579; Q19581'),
	(2718,'WBGene00003904','2010-10-01','2010-10-04','pabp-2','pabp-2 encodes the C. elegans PABPN1 (polyadenylate-binding protein, nuclear 1) ortholog; by homology, PABP-2 is predicted to function as a poly(A)-binding protein involved in several aspects of pre-mRNA processing; large-scale RNAi screens indicate that pabp-2 activity is essential for embryonic and larval development, as well as normal rates of growth and locomotion; in humans, expansion of a polyalanine repeat in PABPN1 is associated with oculopharyngeal muscular dystrophy (OPMD, OMIM:602279)','Caenorhabditis elegans',6239,'RRMx1',0,NULL,NULL,NULL,NULL,'Q93233'),
	(2719,'WBGene00003978','2010-10-01','2010-10-04','pes-4','pes-4 encodes a protein that contains two type 1 KH domains, RNA-binding domains that are present in a diverse group of nucleic acid-binding proteins; pes-4 was identified in promoter-trapping screens and by homology, is predicted to function as an RNA-binding protein; however, the precise role of PES-4 in C. elegans development and/or behavior is not yet known; a pes-4 reporter is expressed in three rectal epithelial cells from the L1 larval stage through adulthood and is also seen dispersed th','Caenorhabditis elegans',6239,'KHx2',0,NULL,NULL,NULL,NULL,'Q95Y67'),
	(2720,'WBGene00004027','2010-10-01','2010-10-04','pie-1','pie-1 encodes a C-x8-C-x5-C-x3-H-type zinc-finger protein; maternally provided PIE-1 is essential for germline cell fate determination, as it functions as a repressor of RNA polymerase II-dependent gene expression in the developing germ line; PIE-1 localization, initially uniform and then concentrated in the posterior germ cell lineages, is regulated by other maternally supplied gene products including PAR-1, MEX-5, and MEX-6.','Caenorhabditis elegans',6239,'Znf_CCCHx2',0,NULL,NULL,NULL,NULL,'Q94131'),
	(2721,'WBGene00004078','2010-10-01','2010-10-04','pos-1','pos-1 encodes a CCCH-type zinc-finger protein; during embryogenesis, maternally provided POS-1 is essential for proper fate specification of germ cells, NUMBERestine, pharynx, and hypodermis; POS-1''s role in cell fate specification is likely as a translational regulator, as POS-1 is required, in posterior blastomeres, for positive regulation of apx-1 mRNA translation and negative regulation of glp-1 mRNA translation via direct binding to the spatial control region (SCR) in the glp-1 mRNA 3'' UTR; in','Caenorhabditis elegans',6239,'Znf_CCCHx2',0,NULL,NULL,NULL,NULL,'Q20667'),
	(2722,'WBGene00004091','2010-10-01','2010-10-04','pps-1','pps-1 is orthologous to human PAPSS1 (OMIM:603262) and human PAPSS2 (OMIM:603005, mutated in spondyloepimetaphyseal dysplasia).','Caenorhabditis elegans',6239,'PUAx1',0,NULL,NULL,NULL,NULL,'Q22501'),
	(2723,'WBGene00004147','2010-10-01','2010-10-04','larp-5','larp-5 encodes an La-related protein containing an La RNA-binding motif and a conserved LARP5 domain; LARP-5 is most closely related to the Larp5 family of metazoan-specific La proteins that includes human and mouse Larp5 as well as Drosophila melanogaster CG11505.','Caenorhabditis elegans',6239,'Lax1',0,NULL,NULL,NULL,NULL,'O44760; Q86S41'),
