	(2726,'WBGene00004239','2010-10-01','2010-10-04','puf-3','The puf-3 gene encodes a predicted RNA binding protein that is a member of the conserved PUF (Pumilio and FBF) family of RNA binding proteins; PUF-3 is expressed in the ovary and is required for multiple aspects of early embryogenesis including proper cell cycle timing, spindle positioning, and formation of the polar bodies and pronuclei.','Caenorhabditis elegans',6239,'PUMx1',0,NULL,NULL,NULL,NULL,'Q9U2G4'),
