	(2732,'WBGene00004245','2010-10-01','2010-10-04','puf-9','The puf-9 gene encodes a predicted RNA binding protein orthologous to Drosophila PUMILIO and human PUMILIO 2 (OMIM:607205); PUF-9 is required for normal locomotion and fluid balance, and is expressed primarily in somatic tissues; PUF-9 contains a glutamine/asparagine-rich domain.','Caenorhabditis elegans',6239,'PUMx1',0,NULL,NULL,NULL,NULL,'Q23191'),
	(2733,'WBGene00004315','2010-10-01','2010-10-04','rbd-1','rbd-1 encodes an ortholog of S. cerevisiae Mrd1p; RBD-1 is required for processing of 18S rRNA and subsequent formation of the 40S ribosomal subunit, and is essential for normal development; in addition, RBD-1 may suppress tumorous growth in the germ line by ensuring robust larval germline proliferation; like PRO-1, -2, and -3, RBD-1''s role in ribosome biogenesis suggests a link between biogenesis in the distal sheath and control of cell division in the germ line; RBD-1 localizes to the nucleolu','Caenorhabditis elegans',6239,'RRMx6',0,NULL,NULL,NULL,NULL,'Q9XU67'),
