	(2761,'WBGene00006321','2010-10-01','2010-10-04','sup-12','sup-12 encodes an RNA-binding protein that contains a conserved RNA recognition motif (RRM); during development, SUP-12 functions to regulate muscle-specific splicing of alternative unc-60 and egl-15 pre-mRNAs; in vitro, SUP-12 can bind unc-60 and egl-15 pre-mRNAs; a sup-12::gfp promoter fusion is expressed in body wall muscle and in the pharynx; in body wall muscle, a SUP-12::GFP localizes to nuclei in a speckled pattern.','Caenorhabditis elegans',6239,'RRMx1',0,NULL,NULL,NULL,NULL,'O45189; B3KM00'),
